// HeroSlider.js

import React, { Component, useState } from 'react';
import Datas from '../../../data/home/hero-slider.json';
import { Link } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';
import Swiper from 'react-id-swiper';
import { Styles } from "../styles/heroSlider.js";

// Mobiscroll Popup
import { Button, Page, Popup, setOptions } from '@mobiscroll/react-lite';
import '@mobiscroll/react-lite/dist/css/mobiscroll.min.css';

setOptions({
  // Mobiscroll options here (theme, locale, etc.)
});

function WelcomePopup() {
  const [isCenterOpen, setCenterOpen] = useState(false);

  return (
    <Page>
      <div style={{ textAlign: 'center', marginBottom: '20px' }}>
        <Button onClick={() => setCenterOpen(true)}>ðŸŽ‰ Welcome Message</Button>
      </div>

      <Popup display="center" isOpen={isCenterOpen} onClose={() => setCenterOpen(false)}>
        <div className="mbsc-align-center mbsc-padding">
          <img src="https://img.mobiscroll.com/demos/logo-noshadow.jpg" alt="logo" />
          <h4>Welcome to Our Lady College!</h4>
          <p>Explore programs, connect with staff, and learn more.</p>
        </div>
      </Popup>
    </Page>
  );
}

class HeroSlider extends Component {
  render() {
    const settings = {
      slidesPerView: 1,
      loop: true,
      speed: 3000,
      autoplay: {
        delay: 3000,
        disableOnInteraction: false
      },
      watchSlidesVisibility: true,
      effect: 'fade',
      navigation: {
        nextEl: '.slider-button-next',
        prevEl: '.slider-button-prev'
      },
      renderPrevButton: () => (
        <div className="swiper-btn slider-button-prev"><i className="flaticon-arrow-left-th"></i></div>
      ),
      renderNextButton: () => (
        <div className="swiper-btn slider-button-next"><i className="flaticon-arrow-right-th"></i></div>
      )
    };

    return (
      <Styles>
        {/* Hero Slider */}
        <section className="hero-slider-area">
          <Swiper {...settings}>
            {
              Datas.map((data, i) => (
                <div className="slider-item" key={i}>
                  <div className="image-container">
                    <img src={process.env.PUBLIC_URL + `/assets/images/${data.backgroundImage}`} className="slider-image" alt={data.backgroundImage} />
                  </div>
                  <div className="slider-table">
                    <div className="slider-tablecell">
                      <Container>
                        <Row>
                          <Col md="12">
                            <div className={data.uniqClass}>
                              <div className="slider-title">
                                <p>{data.title}</p>
                              </div>
                              <div className="slider-desc">
                                <h1>{data.desc}</h1>
                              </div>
                              <div className="slider-btn">
                                <Link className="slider-btn1" to={process.env.PUBLIC_URL + `/${data.btnOneLink}`}>Our Courses</Link>
                                <Link className="slider-btn2" to={process.env.PUBLIC_URL + `/${data.btnTwoLink}`}>Contact Us</Link>
                              </div>

                              {/* ðŸ†• Center Popup Button */}
                              <WelcomePopup />
                            </div>
                          </Col>
                        </Row>
                      </Container>
                    </div>
                  </div>
                </div>
              ))
            }
          </Swiper>
        </section>
      </Styles>
    );
  }
}

export default HeroSlider;
